===============================================\r\n\r\n	 SoftwareMD: Fez Metadata Extension Schema for Software\r\n		\r\n	============================================================-->\r\n	<xsd:element name=\"SoftwareMD\" type=\"SoftwareMDType\"/>\r\n	<xsd:element name=\"programming_language\" />        \r\n	<xsd:complexType name=\"SoftwareMDType\">\r\n		<xsd:sequence>\r\n			<xsd:element ref=\"programming_language\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n</xsd:schema>\r\n','SoftwareMD','',''),(48,'FezHistory','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n\r\n<!-- the root element for FezHistory-->\r\n<xsd:element name=\"FezHistory\" type=\"FezHistoryType\"/>\r\n\r\n<xsd:complexType name=\"FezHistoryType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"audit\" type=\"auditType\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n<xsd:complexType name=\"auditType\">\r\n  <xsd:sequence>\r\n        <xsd:element name=\"audit_id\"/>\r\n        <xsd:element name=\"audit_date\"/>\r\n        <xsd:element name=\"audit_user_id\"/>\r\n        <xsd:element name=\"audit_user_full_name\"/>\r\n        <xsd:element name=\"audit_justification\"/>\r\n        <xsd:element name=\"audit_pid\"/>\r\n        <xsd:element name=\"audit_dsID\"/>\r\n  </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n</xsd:schema>\r\n','FezHistory','',''),(49,'vCard','3.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<schema\r\n	targetNamespace=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	xmlns=\"http://www.w3.org/2001/XMLSchema\"\r\n	xmlns:xlink=\"http://www.w3.org/1999/xlink\"\r\n	xmlns:vCard=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	elementFormDefault=\"qualified\"\r\n	attributeFormDefault=\"qualified\">\r\n\r\n\r\n	<annotation>\r\n		<documentation xml:lang=\"en\">\r\n			vCard XML Schema\r\n                        see http://imlsdcc.grainger.uiuc.edu/registry/default.asp\r\n			Created by Tom Habing, thabing@uiuc.edu\r\n\r\n			XML Schema for representing vCards in XML\r\n\r\n			This schema is based on the Representing vCard Objects in RDF/XML at the W3C http://www.w3.org/TR/vcard-rdf\r\n\r\n		$Workfile:   $ $Revision:   $\r\n\r\n    Last Updated by $Author:   $ on $Modtime:   $\r\n\r\n    $History: vCard.xsd $\r\n\r\n		</documentation>\r\n\r\n		<appinfo xmlns:dc=\"http://purl.org/dc/elements/1.1/\">\r\n			<dc:title>vCard XML Schema</dc:title>\r\n			<dc:creator>Tom Habing, thabing@uiuc.edu</dc:creator>\r\n			<dc:relation>http://www.w3.org/TR/vcard-rdf</dc:relation>\r\n			<dc:relation>ftp://ftp.isi.edu/in-notes/rfc2426.txt</dc:relation>\r\n		</appinfo>\r\n	</annotation>\r\n\r\n  <import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/03/xml.xsd\"/>\r\n	<import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/mets/version14/xlink.xsd\"/>\r\n\r\n	<element name=\"VCARD\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			\r\n\r\n	<element name=\"FN\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NICKNAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"BDAY\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"MAILER\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"GEO\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TITLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"ROLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CATEGORIES\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SOURCE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NOTE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"PRODID\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"REV\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SORT-STRING\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CLASS\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TEL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"voice\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"home\"/>\r\n          					<enumeration value=\"msg\"/>\r\n          					<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n          					<enumeration value=\"voice\"/>\r\n          					<enumeration value=\"fax\"/>\r\n          					<enumeration value=\"cell\"/>\r\n          					<enumeration value=\"video\"/>\r\n          					<enumeration value=\"pager\"/>\r\n          					<enumeration value=\"bbs\"/>\r\n          					<enumeration value=\"modem\"/>\r\n          					<enumeration value=\"car\"/>\r\n          					<enumeration value=\"isdn\"/>\r\n          					<enumeration value=\"pcs\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"EMAIL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"internet\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"internet\"/>\r\n          					<enumeration value=\"x400\"/>\r\n          					<enumeration value=\"pref\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute name=\"OTHERTYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ADR\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Pobox\" minOccurs=\"0\"  maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Extadd\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Street\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Locality\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Region\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Pcode\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Country\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n   		<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n 				<simpleType>\r\n 					<list>\r\n 						<simpleType>\r\n     					<restriction base=\"string\">\r\n       					<enumeration value=\"dom\"/>\r\n       					<enumeration value=\"intl\"/>\r\n       					<enumeration value=\"postal\"/>\r\n       					<enumeration value=\"parcel\"/>\r\n       					<enumeration value=\"home\"/>\r\n       					<enumeration value=\"work\"/>\r\n								<enumeration value=\"pref\"/>\r\n							</restriction>\r\n						</simpleType>\r\n					</list>\r\n 				</simpleType>\r\n   		</attribute>\r\n   		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ORG\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Orgname\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Orgunit\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"N\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Family\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Given\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Other\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Prefix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Suffix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"LABEL\">\r\n		<complexType>\r\n    	<complexContent mixed=\"true\">\r\n				<restriction base=\"anyType\">\r\n        	<sequence>\r\n         		<any processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"0\"/>\r\n        	</sequence>\r\n     			<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n   					<simpleType>\r\n   						<list>\r\n   							<simpleType>\r\n       						<restriction base=\"string\">\r\n         						<enumeration value=\"dom\"/>\r\n         						<enumeration value=\"intl\"/>\r\n         						<enumeration value=\"postal\"/>\r\n         						<enumeration value=\"parcel\"/>\r\n         						<enumeration value=\"home\"/>\r\n         						<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n      						</restriction>\r\n     						</simpleType>\r\n    					</list>\r\n   					</simpleType>\r\n     			</attribute>\r\n     			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</restriction>\r\n    	</complexContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"TZ\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"text\"/>\r\n       						</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"UID\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"PHOTO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"LOGO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"SOUND\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"KEY\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"AGENT\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"GROUP\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"URL\">\r\n		<complexType>\r\n			<attributeGroup ref=\"xlink:simpleLink\"/>\r\n		</complexType>\r\n	</element>\r\n</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n			<attribute ref=\"xml:base\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<complexType name=\"simpleElement\">\r\n    <simpleContent>\r\n      <extension base=\"string\">\r\n        <attribute ref=\"xml:lang\" use=\"optional\"/>\r\n      </extension>\r\n    </simpleContent>\r\n  </complexType>\r\n\r\n	<complexType name=\"binaryElement\">\r\n  	<simpleContent>\r\n   		<extension base=\"base64Binary\">\r\n    		<attribute name=\"ENCODING\" default=\"b\">\r\n  				<simpleType>\r\n  					<list>\r\n  						<simpleType>\r\n      					<restriction base=\"string\">\r\n									<enumeration value=\"b\"/>\r\n									<enumeration value=\"\"/>\r\n        				</restriction>\r\n        			</simpleType>\r\n        		</list>\r\n        	</simpleType>\r\n        </attribute>\r\n    		<attribute name=\"TYPE\" type=\"string\"/>\r\n    		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    		<attributeGroup ref=\"xlink:simpleLink\"/>\r\n   		</extension>\r\n  	</simpleContent>\r\n 	</complexType>\r\n\r\n\r\n<!-- stuff from xlink.xsd -->\r\n\r\n  <!--  global attributes  --> \r\n  <attribute name=\"href\"  type=\"anyURI\"/>\r\n  <attribute name=\"role\" type=\"string\"/>\r\n  <attribute name=\"arcrole\" type=\"string\"/>\r\n  <attribute name=\"title\" type=\"string\" /> \r\n  <attribute name=\"show\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"new\" /> \r\n	<enumeration value=\"replace\" /> \r\n	<enumeration value=\"embed\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"actuate\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"onLoad\" /> \r\n	<enumeration value=\"onRequest\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"label\" type=\"string\" /> \r\n  <attribute name=\"from\" type=\"string\" /> \r\n  <attribute name=\"to\" type=\"string\" /> \r\n  <attributeGroup name=\"simpleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"simple\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"extendedLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"extended\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"locatorLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"locator\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"required\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"arcLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"arc\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:from\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:to\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"resourceLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"resource\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"titleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"title\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"emptyLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"none\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n\r\n\r\n<!-- xml.xsd -->\r\n\r\n  <attribute name=\"lang\" type=\"language\">\r\n  <annotation>\r\n   <documentation>In due course, we should install the relevant ISO 2- and 3-letter\r\n         codes as the enumerated possible values . . .</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attribute name=\"space\" default=\"preserve\">\r\n  <simpleType>\r\n   <restriction base=\"NCName\">\r\n    <enumeration value=\"default\"/>\r\n    <enumeration value=\"preserve\"/>\r\n   </restriction>\r\n  </simpleType>\r\n </attribute>\r\n\r\n <attribute name=\"base\" type=\"anyURI\">\r\n  <annotation>\r\n   <documentation>See http://www.w3.org/TR/xmlbase/ for\r\n                     information about this attribute.</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attributeGroup name=\"specialAttrs\">\r\n  <attribute ref=\"xml:base\"/>\r\n  <attribute ref=\"xml:lang\"/>\r\n  <attribute ref=\"xml:space\"/>\r\n </attributeGroup>\r\n\r\n\r\n\r\n\r\n</schema>\r\n','VCARD','v',''),(50,'geospatialMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\" version=\"0.6.50\">\r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n				This is an ADN item-level CATEGORY schema.\r\n				Tags defined: geospatialCoverages\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>*** LICENSE INFORMATION *****\r\n  		Copyright 2002, 2003 DLESE Program Center\r\n		University Corporation for Atmospheric Research (UCAR)\r\n		P.O. Box 3000, Boulder, CO 80307, United States of America\r\n		email: support@dlese.org. \r\nThese schemas are free software; you can redistribute them and/or modify them under the terms of the GNU General Public License as published by the Free Software Foundation; either version 2 of the License, or (at your option) any later version.  These schemas are distributed in the hope that they will be useful, but WITHOUT ANY WARRANTY; without even the implied warranty of MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the GNU General Public License for more details. You should have received a copy of the GNU General Public License along with this project; if not, write to the Free Software Foundation, Inc., 59 Temple Place, Suite 330, Boston, MA 02111-1307 USA  \r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Other CATEGORY Schemas to Include  ********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  VOCABULARY Schemas to Include  ***********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  ROOT Element  **********************************************\r\n							There is no root element for this schema.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Other Elements  **********************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  (alpha order) *****************************\r\n	\r\n				bodyType  	  				is part of geospatialCoverageType			\r\n				boundBoxType				is part of geospatialCoverageType\r\n				coordinateSystemType		is part of geospatialCoverageType\r\n				detGeoType 					is part of detGeosType\r\n				detGeosType 				is part of geospatialCoverageType\r\n				eventsType  					is part of bbEvents and detailedEvents under boundBoxType and detGeoType\r\n				geospatialCoverageType  	is part of geospatialCoveragesType\r\n				geospatialCoveragesType 	is part of ADNmetdataType in record.xsd \r\n				placeOrEventType			is part of placesType and eventsType\r\n				placesType  					is part of bbPlaces and detailedPlaces under boundBoxType and detGeoType\r\n				projectionType 				is part of geospatialCoverageType\r\n				vertType  						is part of boundBoxType.bbVert and detGeoType.detVert\r\n				vertMinMaxType  			is part of boundBoxType and detGeoType\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:complexType name=\"bodyType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  bodyType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				planet						is a simple type; see planet.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:choice>\r\n			<xsd:element name=\"planet\" type=\"planetType\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"otherPlanetaryBody\" type=\"stringTextType\" maxOccurs=\"1\"/>\r\n		</xsd:choice>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"boundBoxType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  boundBoxType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				westCoord				is a simple type with a patterned decimal\r\n				eastCoord				is a simple type with a patterned decimal\r\n				northCoord				is a simple type with a patterned decimal\r\n				southCoord				is a simple type with a patterned decimal\r\n				bbSrcName				is simple; see commonfields.xsd\r\n				bbSrcIDandURL			is complex; see commonfields.xsd\r\n				bbSrcDesc				is simple; see commonfields.xsd\r\n				bbAccEst				is simple; see commonfields.xsd\r\n				description				is a global; see commonfields.xsd\r\n				bbVert					is complex; no vocab; just child elements\r\n				bbPlaces				is complex; no vocab; just child elements\r\n				bbEvents				is complex; no vocab; just child elements\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"westCoord\" type=\"longitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"eastCoord\" type=\"longitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"northCoord\" type=\"latitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"southCoord\" type=\"latitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"bbSrcName\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbSrcIDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbSrcDesc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbAccEst\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"description\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbVert\" type=\"vertType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbPlaces\" type=\"placesType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbEvents\" type=\"eventsType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"coordinateSystemType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  coordinateSystemType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				type				is a an attribute with a controlled vocab; see coordinateDLESE.xsd\r\n				\r\n				The content of the element is a string with information about the coordinate system.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" type=\"union.coordinateSystemType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detGeoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  detGeoType ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				typeDetGeo				is a simple; see typeDetGeo.xsd\r\n				geoNumPts				is simple\r\n				geoPtOrder				is a simple; see geoPtOrder.xsd\r\n				longLat					is complex\r\n				detSrcName				is simple; see commonfields.xsd\r\n				detSrcIDandURL			is a complex; see commonfields.xsd\r\n				detSrcDesc				is simple; see commonfields.xsd\r\n				detAccEst				is simple; see commonfields.xsd\r\n				description				is a global; see commonfields.xsd\r\n				detVert					is complex; no vocab; just child elements\r\n				detPlaces				is complex; no vocab; just child elements\r\n				detEvents				is complex; no vocab; just child elements\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"typeDetGeo\" type=\"typeDetGeoType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"geoNumPts\" type=\"xsd:positiveInteger\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"geoPtOrder\" type=\"geoPtOrderType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"longLats\" type=\"longLatsType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcName\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcIDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcDesc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detAccEst\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"description\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detVert\" type=\"vertType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detPlaces\" type=\"placesType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detEvents\" type=\"eventsType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detGeosType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  detGeosType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				detGeo				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"detGeo\" type=\"detGeoType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"eventsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  eventsType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				event				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"event\" type=\"placeOrEventType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"geospatialCoverageType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*************************************** geospatialCoverageType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				body							is complex\r\n				geodeticDatumGlobalOrHorz		is a simple type; see geodeticDatumGlobalorHorz.xsd; Unknown and Other part of formal vocab so no use default.xsd\r\n				projection						is complex with an attribute that has a controlled vocab\r\n				coordinateSystem				is complex with an attribute that has a controlled vocab\r\n				boundBox						is complex\r\n				detGeo							is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"body\" type=\"bodyType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"geodeticDatumGlobalOrHorz\" type=\"union.geodeticDatumGlobalOrHorzType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"projection\" type=\"projectionType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"coordinateSystem\" type=\"coordinateSystemType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"boundBox\" type=\"boundBoxType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detGeos\" type=\"detGeosType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"geospatialCoveragesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geospatialCoveragesType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				geogspatialCoverage				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"geospatialCoverage\" type=\"geospatialCoverageType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"longLatType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longLatType*************************************************\r\n				These elements have the following types or schema associated with them.\r\n				longitude				is a simple type\r\n				latitude					is a simple type\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"longitude\" type=\"longitudeType\" use=\"required\"/>\r\n				<xsd:attribute name=\"latitude\" type=\"latitudeType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"longLatsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longLatsType*************************************************\r\n				These elements have the following types or schema associated with them.\r\n				longLat				is a simple type\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"longLat\" type=\"longLatType\" minOccurs=\"1\" maxOccurs=\"unbounded\" nillable=\"true\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"placeOrEventType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  placeOrEventType  ********************************************\r\n				These elements have the following types or schema associated with them.\r\n				name				is a global; see commonfields.xsd\r\n				source				is a global; see commonfields.xsd\r\n				IDandURL			is complex; see commonfields.xsd\r\n				sourceDesc			is a global; see commonfields.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element ref=\"name\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"source\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"IDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"sourceDesc\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"placesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  placesType  ************************************************\r\n				These elements have the following types or schema associated with them.\r\n				place					is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"place\" type=\"placeOrEventType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"projectionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  projectionType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				type				is a an attribute of simple type\r\n				\r\n				Uknown and Other are part of formal vocab so no use default.xsd\r\n				Otherwise the content of the element is a string with information about the projection.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" type=\"union.projectionType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertBaseInfoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertBaseInfoType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				vertBaseType	see vertBase.xsd\r\n				desc				information about the vertical base level; often describes the datum used\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"vertBaseType\">\r\n				<xsd:attribute name=\"desc\" type=\"xsd:string\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				geodeticDatumGlobalOrVert		is a simpl; see geodeticDatumGlobalOrVert.xsd; Unknown and Other part of formal vocab so no use default.xsd \r\n				vertBase							is complex;\r\n				vertMin							is complex; a decimal with a controlled vocab attribute in verticalUnits.xsd\r\n				vertMax							is complex; a decimal with a controlled vocab attribute in verticalUnits.xsd\r\n				vertAcc							is complex; non-empty string; see commonfields.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"geodeticDatumGlobalOrVert\" type=\"union.geodeticDatumGlobalOrVertType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"vertBase\" type=\"vertBaseInfoType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"vertMin\" type=\"vertMinMaxType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"vertMax\" type=\"vertMinMaxType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"vertAcc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertMinMaxType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertMinMaxType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				units				is a an attribute with a controlled vocab; see verticalUnits.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:decimal\">\r\n				<xsd:attribute name=\"units\" type=\"verticalUnitsType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************\r\n\r\n				latitudeType									is a patterned decimal\r\n				longitudeType								is a patterned decimal\r\n				longLatType									is a patterned string\r\n\r\n				union.geodeticDatumGlobalOrHorzType		see geodeticDatumGlobalOrHorzDLESE.xsd;Unknown and Other part of formal vocab so no use default.xsd\r\n				union.geodeticDatumGlobalOrVertType		see geodeticDatumGlobalOrVertDLESE.xsd;Unknown and Other part of formal vocab so no use default.xsd\r\n				union.projectionType						see projectionDLESE.xsd\r\n				union.coordinateSystemType				see coordinateDLESE.xsd\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"latitudeType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  latitudeType  ***********************************************\r\n				The pattern element is added to ensure that a null tag set is *not* interpreted as a value of zero.\r\n				A pattern of ([+-][0-9]{2}(\\.[0-9]{2})) is too strict a requirement because it forces 9.2 to be 09.20\r\n				A pattern of  -?\\d{1,2}\\.\\d{1,2} is also too strict in that is requires a decimal.\r\n				Decimal degrees is assumed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:decimal\">\r\n			<xsd:minInclusive value=\"-90.00\"/>\r\n			<xsd:maxInclusive value=\"90.00\"/>\r\n			<xsd:totalDigits value=\"4\"/>\r\n			<xsd:fractionDigits value=\"2\"/>\r\n			<xsd:pattern value=\"-?\\d{0,2}\\.?\\d{1,2}\" />\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"longitudeType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longitudeType  ***********************************************\r\n				The pattern element is added to ensure that a null tag set is *not* interpreted as a value of zero.\r\n				A pattern of ([+-][0-9]{3}(\\.[0-9]{2})) is too strict a requirement because it forces 9.2 to be 009.20\r\n				A pattern of -?1?\\d{1,2}\\.\\d{1,2} is also too strict in that it requires a decimal to be present.\r\n				Decimal degrees is assumed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:decimal\">\r\n			<xsd:minInclusive value=\"-180.00\"/>\r\n			<xsd:maxInclusive value=\"180.00\"/>\r\n			<xsd:totalDigits value=\"5\"/>\r\n			<xsd:fractionDigits value=\"2\"/>\r\n			<xsd:pattern value=\"-?\\d{0,3}\\.?\\d{1,2}\" />\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.geodeticDatumGlobalOrHorzType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.geodeticDatumGlobalOrHorzType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEgeodeticDatumGlobalOrHorzType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.geodeticDatumGlobalOrVertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.geodeticDatumGlobalOrVertType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEgeodeticDatumGlobalOrVertType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.coordinateSystemType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.coordinateSystemType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEcoordinateType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.projectionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.projectionType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEprojectionTypesType\"/>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEcoordinateType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEcoordinateType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:Geographic latitude and longitude\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEcoordinateLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEcoordinateLeafType  *****************************************\r\n				Lists leaf values\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Geographic latitude and longitude\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrHorzType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geodeticGlobalOrHorzType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"DLESE:NAD27\"/>\r\n			<!--NAD27 is a horizontal datum: North American Datum from 1927-->\r\n			<xsd:enumeration value=\"DLESE:NAD83\"/>\r\n			<!--NAD83 is a horizontal datum: North American Datum from 1983-->\r\n			<xsd:enumeration value=\"DLESE:ATS77\"/>\r\n			<!--ATS77 is a horizontal datum-->\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<!--the attribute datumGH will indicate whether the datum is horizontal or global-->\r\n			<xsd:enumeration value=\"DLESE:Unknown\"/>\r\n			<!--if this value is entered will still get info if have lat/long-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrHorzLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEgeodeticDatumGlobalOrHorzLeafType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"NAD27\"/>\r\n			<!--NAD27 is a horizontal datum: North American Datum from 1927-->\r\n			<xsd:enumeration value=\"NAD83\"/>\r\n			<!--NAD83 is a horizontal datum: North American Datum from 1983-->\r\n			<xsd:enumeration value=\"ATS77\"/>\r\n			<!--ATS77 is a horizontal datum-->\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<!--the attribute datumGH will indicate whether the datum is horizontal or global-->\r\n			<xsd:enumeration value=\"Unknown\"/>\r\n			<!--if this value is entered will still get info if have lat/long-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 	ADN-I (item)\r\n			Source org:			Government of Ontario Information and Technology Standards; http://www.gov.on.ca/MBS/techstan/\r\n			Source values:		http://www.gov.on.ca/MBS/techstan/72-00apa.htm\r\n			Source last update:	1996\r\n			DPC last update:		2002-10-31\r\n			Notes: 	\r\n			NAVD29 is National Geodetic Vertical Datum of 1929			\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>2003-2-6: Definition: Verical datum is a base reference for a coordinate system. It includes the position of an initial point of orgin and the orientation of an ellipsoid that models the surface of the earh in the region of interest.\r\n2003-2-6: There are horizontal, veritcal and global datums.\r\n2003-2-6: The schema has both global and vertical datums with global datums listed first.\r\n2003-2-6: Added DLESE: and kept Other to the vocab because there are so many local vertical datums that could be used.\r\n2003-2-6: Removed vocab term Unknown because vertical measurements can\'t have an unknown datum while they can have an Other\r\n2003-2-6: Added Sea level because it is the most popular vertical reference point.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrVertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geodeticGlobalOrVertType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"DLESE:CGD28-CDN\"/>\r\n			<!--CGD28-CDN is a vertical datum used in Canada-->\r\n			<xsd:enumeration value=\"DLESE:NAVD29-USA\"/>\r\n			<!--NAVD29 is a vetical datum used in North American, est. 1929-->\r\n			<xsd:enumeration value=\"DLESE:NAVD88\"/>\r\n			<!--NAVD88 is a vertical datum used in North American, est. 1988-->\r\n			<xsd:enumeration value=\"DLESE:IGLD55\"/>\r\n			<!--IGLD55 is a vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:IGLD88\"/>\r\n			<!--IGLD88 is a vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:Sea level\"/>\r\n			<!-- Sea level is vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<!-- the attribute datumGV will indicate whether it is veritcal or horizontal-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrVertLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEgeodeticDatumGlobalOrVertLeafType  ***********************\r\n				Lists leaf values\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"CGD28-CDN\"/>\r\n			<!--CGD28-CDN is a vertical datum used in Canada-->\r\n			<xsd:enumeration value=\"NAVD29-USA\"/>\r\n			<!--NAVD29 is a vetical datum used in North American, est. 1929-->\r\n			<xsd:enumeration value=\"NAVD88\"/>\r\n			<!--NAVD88 is a vertical datum used in North American, est. 1988-->\r\n			<xsd:enumeration value=\"IGLD55\"/>\r\n			<!--IGLD55 is a vertical datum-->\r\n			<xsd:enumeration value=\"IGLD88\"/>\r\n			<!--IGLD88 is a vertical datum-->\r\n			<xsd:enumeration value=\"Sea level\"/>\r\n			<!-- Sea level is vertical datum-->\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<!-- the attribute datumGV will indicate whether it is veritcal or horizontal-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"geoPtOrderType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>*****  geoPtOrderType  *****</xsd:documentation>\r\n			<xsd:documentation>indicates how to interpret a polygon or bounding box based on the geographic footprint</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Inside\"/>\r\n			<xsd:enumeration value=\"Outside\"/>\r\n			<xsd:enumeration value=\"None\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"planetType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  planetVocabType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Mercury\"/>\r\n			<xsd:enumeration value=\"Venus\"/>\r\n			<xsd:enumeration value=\"Earth\"/>\r\n			<xsd:enumeration value=\"Mars\"/>\r\n			<xsd:enumeration value=\"Jupiter\"/>\r\n			<xsd:enumeration value=\"Saturn\"/>\r\n			<xsd:enumeration value=\"Uranus\"/>\r\n			<xsd:enumeration value=\"Neptune\"/>\r\n			<xsd:enumeration value=\"Pluto\"/>\r\n			<xsd:enumeration value=\"Earth\'s Moon\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEprojectionTypesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEprojectionTypesType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:Albers conical equal area\"/>\r\n			<xsd:enumeration value=\"DLESE:Does not apply\"/>\r\n			<xsd:enumeration value=\"DLESE:Lambert azimuthal equal area\"/>\r\n			<xsd:enumeration value=\"DLESE:Lambert conformal conic\"/>\r\n			<xsd:enumeration value=\"DLESE:Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<xsd:enumeration value=\"DLESE:Polar stereographic\"/>\r\n			<xsd:enumeration value=\"DLESE:Transverse Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Space oblique Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Unknown\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEprojectionTypesLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEprojectionTypesLeafType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Albers conical equal area\"/>\r\n			<xsd:enumeration value=\"Does not apply\"/>\r\n			<xsd:enumeration value=\"Lambert azimuthal equal area\"/>\r\n			<xsd:enumeration value=\"Lambert conformal conic\"/>\r\n			<xsd:enumeration value=\"Mercator\"/>\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<xsd:enumeration value=\"Polar stereographic\"/>\r\n			<xsd:enumeration value=\"Transverse Mercator\"/>\r\n			<xsd:enumeration value=\"Space oblique Mercator\"/>\r\n			<xsd:enumeration value=\"Unknown\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"typeDetGeoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  typeDetGeoType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Point\"/>\r\n			<xsd:enumeration value=\"Bounding box\"/>\r\n			<xsd:enumeration value=\"Polyline\"/>\r\n			<xsd:enumeration value=\"Polygon\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"vertBaseType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertBaseType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Datum level\"></xsd:enumeration>\r\n			<xsd:enumeration value=\"Ground level\"></xsd:enumeration>\r\n			<xsd:enumeration value=\"Sea level\"></xsd:enumeration>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"verticalUnitsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  verticalUnitsType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"centimeters (cm)\"/>\r\n			<xsd:enumeration value=\"meters (m)\"/>\r\n			<xsd:enumeration value=\"kilometers (km)\"/>\r\n			<xsd:enumeration value=\"inches (in)\"/>\r\n			<xsd:enumeration value=\"feet (ft)\"/>\r\n			<xsd:enumeration value=\"miles (mi)\"/>\r\n			<xsd:enumeration value=\"fathoms (fathoms)\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Schema Overview  **************************************************************\r\n		This is an ADN CATEGORY schema used by both the ADN-item and ADN-collection metadata frameworks.\r\n		It defines global elements in both frameworks and common types across the CATEGORY schemas.		\r\n		\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Other CATEGORY Schemas to Include  ********************************\r\n							There are no other framework schemas to include.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  VOCABULARY Schemas to Include  ***********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  ROOT Element  **********************************************\r\n							There is no root element for this schema.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  GLOBAL Elements  (alpha order)  *******************************	\r\n				The individual FRAMEWORK schemas determine the minimum and maximum occurrences for these elements.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:element name=\"description\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"language\" type=\"xsd:language\"/>\r\n	<xsd:element name=\"name\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"source\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"sourceDesc\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"title\" type=\"stringTextType\"/>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  (alpha order) *****************************\r\n\r\n				catalogType						is part of catalogEntriesType\r\n				catalogEntriesType				used in general, metaMetadata and relation\r\n				IDandURLType 					used in many places\r\n				organizationType				used in lifecycle and metaMetadata\r\n				personType						used in lifecycle and metaMetadata\r\n\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:complexType name=\"catalogType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  catalogType  *********************************************************\r\n				entry					is an attribute\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"entry\" type=\"xsd:string\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"catalogEntriesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  catalogEntriesType  *****************************************************\r\n				These elements have the following types or schema associated with them.\r\n				catalog					is complex\r\n				\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"catalog\" type=\"catalogType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"IDandURLType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  IDandURLType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				URL			is a an attribute string\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"URL\" type=\"stringTextType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"organizationType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*******************************************  organizationType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				email					is a simple type\r\n				Note: xsd:string is used because transforms (particularly from DLESE-IMS to ADN) and the suppression of cataloger information may cause no content. But if the tag is required, then this null content must be allowed to happend. Therefore, use xsd:string (on the required elements except email) becuase it allows null compared to stringTextType.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"instName\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instDept\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instPosition\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instUrl\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instEmail\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"contactID\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"personType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*******************************************  personType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				nameTitle				is a simple type; see nameTitle.xsd\r\n				emailPrimary			is a simple type\r\n				emailAlt					is a simple type\r\n				Note: xsd:string is used because transforms (particularly from DLESE-IMS to ADN) and the suppression of cataloger information may cause no content. But if the tag is required, then this null content must be allowed to happend. Therefore, use xsd:string (on the required elements except email) becuase it allows null compared to stringTextType.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"nameTitle\" type=\"nameTitleType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameFirst\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameMiddle\" type=\"xsd:string\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameLast\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instName\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instDept\" type=\"xsd:string\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"emailPrimary\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"emailAlt\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"contactID\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************\r\n				emailType\r\n				stringTextType\r\n				union.dateType\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"emailType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>E-Mail address on the Internet (must be in name@company.net format) Both numbers and letters are allowed on either side of the @ sign.\r\n*********************** Not currently being used. But may be used in the future. *************************8\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:pattern value=\"[\\p{L}_-{\\d}]+(\\.[\\p{L}_-{\\d}]+)*@[\\p{L}_{\\d}]+(\\.[\\p{L}_{\\d}]+)+\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"stringTextType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n					Use this patterned string to ensure that a null tag is not valid string content.\r\n					Note: that xsd:string allows content to be null even if the element is required.\r\n					Note: xsd:string is used in person and organization because for some situations null may be needed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:pattern value=\".[\\S\\s]*\"/>\r\n<!--			<xsd:pattern value=\"(.)+\"/> does not allow carriage returns -->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.dateType\">\r\n		<xsd:union memberTypes=\"xsd:date xsd:gYearMonth xsd:gYear dateType\"/>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Schema Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 		ADN-I (item)\r\n			Source org:			DLESE Program Center (DPC); http://www.dlese.org\r\n			Source values:		DPC\r\n			Source last update:	2002-10-31\r\n			DPC last update:		2002-10-31\r\n			Notes: 				Developed and maintained by the DPC.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  ******************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"nameTitleType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  nameTitleType  *********************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Dr\"/>\r\n			<xsd:enumeration value=\"Miss\"/>\r\n			<xsd:enumeration value=\"Mr\"/>\r\n			<xsd:enumeration value=\"Mrs\"/>\r\n			<xsd:enumeration value=\"Ms\"/>\r\n			<xsd:enumeration value=\"Prof\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n       \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 		ADN-I (item)\r\n			Source org:			DLESE Program Center (DPC); http://www.dlese.org\r\n			Source values:		DPC\r\n			Source last update:	2003-06-11\r\n			DPC last update:		2003-06-11\r\n			Notes: 				Developed and maintained at the DPC.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"dateType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  dateVocabType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Present\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:element name=\"geospatialCoveragesMD\" type=\"geospatialCoveragesType\"/>\r\n\r\n</xsd:schema>\r\n','geospatialCoveragesMD','',''),(52,'AudioMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- edited with XML Spy v4.0.1 (http://www.xmlspy.com) by D. Casey (User Technology Associates, Inc.) -->\r\n<xs:schema targetNamespace=\"http://www.loc.gov/AMD/\" xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" xmlns=\"http://www.loc.gov/AMD/\" elementFormDefault=\"qualified\">\r\n	<!--============================================================\r\n\r\n  AUDIOMD: Audio Technical Metadata Extension Schema  \r\n  Initial Version:  AMD_020322.xsd (obtained from Carl\'s webpage on 03/27/2002)\r\n\r\n  Changes 03/27/2002:\r\n  DKC- Removed duplicate elements \"note\" and \"num_channels\" from the \r\n        complexType node \"physical_dataType\".\r\n     - Removed \"calibration\" from \"file_data\" due to its inclusion in \r\n        \"calibration_info\".\r\n     - Removed \"duration\" from \"physical_data\" due to its inclusion in \r\n        \"time_info\".\r\n  Changes 04/03/2002:\r\n  DKC- Duplicated the AUDIOMD node to create the AUDIOSRC node.  Removed \r\n        \"physical_data\" from AUDIOMD and \"file_data\" from AUDIOSRC.\r\n     - Created a \"audio_info\" node and moved the following nodes into it: note, \r\n        num_channels, sound_field, sound_channel_map, duration\r\n  Changes 07/25/2002\r\n  DKC- Abstracted the root element in order to provide support for both analog \r\n        and digital sources.\r\n     - Simplified the structure to eliminate the unecessary element references \r\n        and complex types.\r\n  Changes 08/22/2002\r\n  DKC- Cleaned up much of the documentation and definitions.  This should \r\n        continue.\r\n  \r\n============================================================ -->\r\n	<xs:element name=\"AUDIOMD\" type=\"audioType\"/>\r\n	<xs:element name=\"AUDIOSRC\" type=\"audioType\"/>\r\n	<xs:element name=\"file_data\" type=\"file_dataType\"/>\r\n	<xs:element name=\"physical_data\" type=\"physical_dataType\"/>\r\n	<xs:element name=\"audio_info\" type=\"audio_infoType\"/>\r\n	<xs:element name=\"calibration_info\" type=\"calibrationType\"/>\r\n	<xs:annotation>\r\n		<xs:documentation>AMD: LC-AV Audio Metadata Extension Schema.\r\n			AMD contains technical metadata that describes either a digital file or a physical source object.  It is \r\n			based upon metadata elements developed by both LC and AES.  AMD is an interim schema being used \r\n			until a final extension schema is adopted.  AUDIOMD and AUDIOSRC both complex types named \"audioType\" \r\n			and contain 4 top-level elements and 2 attributes,\r\n		        	ID: (XML ID)\r\n        			ANALOGDIGITALFLAG:  A major indicator of the type of audio object i.e Analog, PhysDigital, or FileDigital.\r\n    </xs:documentation>\r\n	</xs:annotation>\r\n	<xs:complexType name=\"audioType\">\r\n		<xs:annotation>\r\n			<xs:documentation>audioType: complexType for encapsulating and organizing within a singleparent element \r\n				the individual audio metadata elements that describe an object or portion of an object.  The four individual \r\n				elements that comprise an audio object are documented under their corresponding types.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"file_data\" type=\"file_dataType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"physical_data\" type=\"physical_dataType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"audio_info\" type=\"audio_infoType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_info\" type=\"calibrationType\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n		<xs:attribute name=\"ANALOGDIGITALFLAG\" use=\"required\">\r\n			<xs:simpleType>\r\n				<xs:restriction base=\"xs:NMTOKEN\">\r\n					<xs:enumeration value=\"Analog\"/>\r\n					<xs:enumeration value=\"PhysDigital\"/>\r\n					<xs:enumeration value=\"FileDigital\"/>\r\n				</xs:restriction>\r\n			</xs:simpleType>\r\n		</xs:attribute>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"file_dataType\">\r\n		<xs:annotation>\r\n			<xs:documentation>file_data: The file_data element is used to describe technical characteristics of an audio \r\n				file.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"audio_block_size\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>audio_block_size: This is the simple element which provides a place to store the \r\n						size of an audio block (frame or sample) in bytes.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"audio_data_encoding\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>audio_data_encoding: This is the simple element which provides a place to store \r\n						the encoding scheme of audio data,  e.g., pulse code modulation (PCM).</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"bits_per_sample\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>bits_per_sample: This is the simple element which provides a place to store the \r\n						size of a single digital audio sample in bits.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"byte_order\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>byte_order: This is the simple element which provides a place to store the order \r\n						of bit significance in a byte from left to right.  i.e. 0-least-to-most, 1-most-to-least.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:int\">\r\n						<xs:enumeration value=\"0\"/>\r\n						<xs:enumeration value=\"1\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"checksum\" type=\"checksumType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"compression\" type=\"compressionType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"data_rate\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>data-_rate: This is the simple element which provides a place to store the data rate \r\n						(e.g. 1.5 Mbps, 4Mbps, etc...) of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"data_rate_mode\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>data_rate_mode: This is the simple element which provides a place to store the data \r\n						rate mode of the audio file, e.g., fixed or variable.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:string\">\r\n						<xs:enumeration value=\"Fixed\"/>\r\n						<xs:enumeration value=\"Variable\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"first_sample_offset\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>first_sample_offset: This is the simple element which provides a place to store the \r\n						location of the first valid sound sample in the file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"first_valid_byte_block\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>first_valid_byte_block: This is the simple element which provides a place to store \r\n						the location of the first valid sound byte in the block.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_name\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_name: This is the simple element which provides a place to store the official \r\n						name for the file format taken from the format documentation,  e.g.  \"Broadcast Wave Format\" or \r\n						\"Raw\".</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_note: This is the simple element which provides a place to store application \r\n						specific information about the audio file.  e.g. SoundForge 5.0, WaveLab 3.0, etc....</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_version\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_version: This is the simple element which provides a place to store the version \r\n						of the audio format specified in format_name e.g. for format_name=\"Broadcast Wave Format\" \r\n						format_version=\"3.0\".</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"last_valid_byte_block\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>last_valid_byte_block: This is the simple element which provides a place to store the \r\n						location of the last valid sound byte in the block.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"num_sample_frames\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>num_sample_frames: This is the simple element which provides a place to store the \r\n						sample point value for a frame in the audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"sampling_frequency\" type=\"xs:float\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>sampling_frequency: This is the simple element which provides a place to store the \r\n						sampling frequency of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"security\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>security: This is the simple element which provides a place to store the type of \r\n						security precautions applied to the file e.g. password, encryption, hidden, etc.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"use\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>use: This is the simple element which provides a place to store the use of a digital \r\n						audio file, e.g., Master, Service High, Service Low, Preview.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:string\">\r\n						<xs:enumeration value=\"Master\"/>\r\n						<xs:enumeration value=\"Service\"/>\r\n						<xs:enumeration value=\"Service_High\"/>\r\n						<xs:enumeration value=\"Service_Low\"/>\r\n						<xs:enumeration value=\"Preview\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"word_size\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>word_size: This is the simple element which provides a place to store the numberof \r\n						bytes that comprise a single sample of audio data; may be greater than actual significant sample size \r\n						expressed in bits.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"physical_dataType\">\r\n		<xs:annotation>\r\n			<xs:documentation>physical_data: The physical_data element describes the physical nature of an audio object if \r\n				it exists as such (i.e. it is not a file).  This will generally apply to analog items but may also be used to describe \r\n				digital formats such as open reel digital, DAT, ADAT tape, CD-R, etc....</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"condition\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>condition: This is the simple element which provides a place to store the physical \r\n						condition of an audio item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"dimensions\" type=\"dimensionsType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"disposition\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>disposition: This is the simple element which provides a place to store what became \r\n						of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"equalization\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>equalization:This is the simple element which provides a place to store the \r\n						equalization specifications or characteristics of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"generation\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>generation: This is the simple element which provides a place to store the generation \r\n						of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"groove\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>groove: This is the simple element which provides a place to store the type of disc \r\n						groove of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"material\" type=\"materialType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"noise_reduction\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>noise_reduction: This is the simple element which provides a place to store the type \r\n						of noise reduction used in an audio source item, if any.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"phys_format\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>phys_format: This is the simple element which provides a place to store the \r\n						physical format of the audio item.  e.g. reel-to-reel tape, 1/4 inch cassette, etc...</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed: This is the simple element which provides a place to store the nominal \r\n						playback speed of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed_adjustment\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed_adjustment: This is the simple element which provides a place to store the \r\n						speed adjustment required to playback an audio source item at its nominal speed.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed_note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed_note: This is the simple element which provides a place to store the \r\n						miscellaneous information about the speed of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"track_format\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>track_format: This is the simple element which provides a place to store the track \r\n						format of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"tracking\" type=\"trackingType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"audio_infoType\">\r\n		<xs:annotation>\r\n			<xs:documentation>audio_info: The audio_info element is used to describe audio characteristics of an object \r\n				that not specific to either the physical object or a digital representation.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"duration\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>duration: This is the simple element which provides a place to store the \r\n						duration of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>note: This is the simple element which provides a place to store miscellaneous \r\n						information about the audio item.  e.g. digital alterations or enhancements to improve \r\n						quality.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"num_channels\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>num_channels: This is the simple element which provides a place to store the \r\n						number of channels of audio in the audio item.  e.g. 1, 2, 5, 6, etc...</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"sound_channel_map\" type=\"sound_channel_mapType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"sound_field\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>sound_field: This is the simple element which provides a place to store the \r\n						aural space of the item or portion of an item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"calibrationType\">\r\n		<xs:annotation>\r\n			<xs:documentation>calibrationType: complexType for storing the type of calibration related characteristics of \r\n				an audio object, regardless of physical or digital format.\r\n				calibrationType has 1 attribute and 4 elements. \r\n	       	 		ID: (XML ID) \r\n       	 			- calibration_ext_int: indicates whether the calibration data is within digital audio file or in a separate file; \r\n		        		- calibration_location: the location of the calibration file if it is external  e.g. URN, URL, etc...; \r\n        				- calibration_time_stamp: the start time of the calibration file if it is internal  i.e. HH:MM:SSss...;\r\n		        		- calibration_type: defines the type of calibration data.\r\n			</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"calibration_ext_int\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_location\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_time_stamp\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_track_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"checksumType\">\r\n		<xs:annotation>\r\n			<xs:documentation>checksumType: complexType for recording the type of checksum used for a digital audio file.  \r\n				In most cases, this will be an md5 checksum as this is the only checksum allowed within the METS schema.\r\n				checksumType has 1 attribute and 3 elements. \r\n		        		ID: (XML ID) \r\n        				- checksum_datetime: datetime the checksum was calculated and applied; \r\n		        		- checksum_type: the type of checksum used;\r\n        				- checksum_value: the checksum value.\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"checksum_datetime\" type=\"xs:dateTime\" minOccurs=\"0\"/>\r\n			<xs:element name=\"checksum_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"checksum_value\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"compressionType\">\r\n		<xs:annotation>\r\n			<xs:documentation>compressionType: complexType for recording the type of compression used for a digital \r\n			audio file.\r\n			compressionType has 1 attribute and 3 elements. \r\n	        		ID: (XML ID) \r\n       	 		- codec_creator_app: name of the creator of the compression application e.g. SoundForge, etc...; \r\n        			- codec_creator_app_version: version of the compression application  e.g. 5.0, etc...; \r\n        			- codec_name: the name of the compression algorithm used e.g. Fraunhofer, Huffman, etc..;\r\n	        		- codec_quality: impact of the  compression on quality  e.g. lossless or lossy.\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"codec_creator_app\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_creator_app_version\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_name\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_quality\" minOccurs=\"0\">\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:NMTOKEN\">\r\n						<xs:enumeration value=\"lossless\"/>\r\n						<xs:enumeration value=\"lossy\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"dimensionsType\">\r\n		<xs:annotation>\r\n			<xs:documentation>dimensionsType: Complex Type for recording the dimensions of an object. \r\n			dimensionsType has the following attributes:\r\n	        		1. DEPTH: the depth as a floating point number;\r\n       	 		2. DIAMETER: The diameter of a circular item as a floating point number;\r\n        			3. GAUGE: The width of the medium unwound (e.g. tape);\r\n        			4. HEIGHT: The height as a floating point number;\r\n	        		5. LENGTH: The length of the medium unwound (e.g. tape);\r\n       	 		6. NOTE: Miscellaneous information about the dimensions;\r\n        			7. THICKNESS: the thickness of the medium unwound (e.g. tape);\r\n	        		8. UNITS: the unit of measurement;\r\n       	 		9. WIDTH: the width as a floating point number.\r\n			</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:attribute name=\"DEPTH\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"DIAMETER\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"GAUGE\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"HEIGHT\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"LENGTH\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"NOTE\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"THICKNESS\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"UNITS\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"WIDTH\" type=\"xs:float\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"materialType\">\r\n		<xs:annotation>\r\n			<xs:documentation>materialType: Complex Type for recording the physical characteristics of the construction and \r\n				material of an audio source item.\r\n				materialType has 1 attribute and 6 elements. \r\n		        		ID: (XML ID)\r\n       		 		- base_material: type of material used in the recording carrier  e.g plastic, glass, vinyl, mylar, etc...\r\n        				- binder: type of adhesive used to bind the recording surface to the substrate \r\n		        		- disc_surface: the type of recording surface aluminium, celluloid etc..\r\n        				- oxide: type of oxide used on the recording surface,  e.g. cobalt, chromium dioxide, ferrous oxide\r\n		        		- reflective_layer: type of material used on the recording surface, e.g. dye, tellurium-selenium alloy, etc..\r\n        				- stock_brand: name of the manufacturer of the recording medium, e.g. Scotch, Maxell, Sony, etc...\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"base_material\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"binder\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"disc_surface\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"oxide\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"reflective_layer\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"stock_brand\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"sound_channel_mapType\">\r\n		<xs:annotation>\r\n			<xs:documentation>sound_channel_mapType:  Complex type for describing the aural layout of any audio tracks.  \r\n				The sound_channel_map element is used to wrap any number of channel_assignment elements.  This \r\n				structure is used to describe the relationship of sound channels to their destination.  Generally, the destination \r\n				will be a location on the sound stage though it could also be something more specialized such as a time code \r\n				reader or even the channels of a mixing board.  The channel_assignment element maps a sound channel to \r\n				its destination.  There are 2 required attributes. The channe_num identifies the sound channel of this audio \r\n				object. Note that the first channel_num is 0 while each subsequent channel is incremented by 1.  \r\n				The map_location attribute specifies the destination.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"channel_assignment\" minOccurs=\"0\">\r\n				<xs:complexType>\r\n					<xs:attribute name=\"CHANNELNUM\" type=\"xs:nonNegativeInteger\"/>\r\n					<xs:attribute name=\"MAPLOCATION\" type=\"xs:string\"/>\r\n				</xs:complexType>\r\n			</xs:element>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"trackingType\">\r\n		<xs:annotation>\r\n			<xs:documentation>trackingType: Complex Type for recording tracking information about an audio source item.  \r\n			trackingType has 1 attribute and 2 elements. \r\n        			ID: (XML ID) \r\n				- tracking_type: The type of tracking code, e.g., MAVIS number, actual shelf numbers, bar-code, etc.;\r\n	        		- tracking_value: Shelf number or other identifier for source, e.g., MAVIS number, actual shelf numbers, etc..\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"tracking_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"tracking_value\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n</xs:schema>\r\n','AUDIOMD','',''),(82,'XACML','2.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xs:schema xmlns:xacml=\"urn:oasis:names:tc:xacml:2.0:policy:schema:os\"